SPARQL:
PREFIX qpr:<http://istresearch.com/qpr>
SELECT ?email ?ad
WHERE
{	?ad a qpr:Ad ;
	qpr:phone '9495329903' ;
	qpr:weight '125 lbs' ;
	qpr:ethnicity 'Caucasian' ;
	qpr:eye_color 'blue' ;
	qpr:hair_color 'blonde' ;
	qpr:age '24' ; 
	qpr:location 'Boston' ;
	qpr:email ?email .  
}

PREFIX qpr:<http://istresearch.com/qpr>
SELECT ?name ?ad
WHERE
{	?ad a qpr:Ad ;
	qpr:ethnicity 'Caucasian' ;
	qpr:age '34' ;
	qpr:height '5"5' ;
	qpr:location 'New Orleans' ;
	qpr:name ?name .
}
